import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHtml5, faCss3, faSass, faJsSquare  } from '@fortawesome/free-brands-svg-icons';
import styles from "./SkillsList.module.scss";

export const SkillsList = () => {
  return (
    <div className={styles.skills_list}>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faHtml5} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faCss3} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faSass} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faJsSquare} size="4x" />
      </div>
      <div className={styles.skills_list_icon}>
      <FontAwesomeIcon icon={faGithubSquare} size="4x" />
        <i class="fab fa-github-square fa-4x icon"></i>
      </div>
    </div>
  );
};
